		pyasukp -nosolve -form hi2 -save "hi2_n${n}-${i}-s${seeds[$i]}c${cs2[$i]}" -seed ${seeds[$i]} -cap ${cs2[$i]} -pmin $pmin -wmin $wmin -wmax $wmax -n $n
	done
done

